  text-align: center;
`;
const Button = styled.button`
  background-color: #778899;
  border: none;
  padding: 10px 50px;
  font-size: 24px;
  color: #fff;
  border-radius: 5px;
  &:hover {
    background-color: #505b66;
  }
`;

const Results = () => {
  const navigate = useNavigate();
  const handleClickBtn = () => {
    navigate("/");
  };
