          <img
            className="rounded-circle" //bootstrap
            src={resultData.image}
            width={350}
            height={350}
          />
        </LogoImage>
        <Desc>
          ÎãπÏã†Ïùò MBTIÎäî {resultData.name}Ïù∏ {resultData.best} ÏûÖÎãàÎã§.
        </Desc>
        <Desc>{resultData.desc}</Desc>
        <Button onClick={handleClickBtn}>ÌÖåÏä§Ìä∏ Îã§ÏãúÌïòÍ∏∞</Button>
      </Content>
    </Wrapper>
  );
};

export default Results;
